    background-color: #fff; 
    height: 100vh;
    width: 100%;
    display: flex; 
    justify-content: center;
    align-items: center;
`

const AbsoluteMaize = styled.div`
    height: 50vh;
    position: absolute;
    top: 0;
    left: 0;
